import React from 'react'; // Import the Component component from React

import ProjectHeader from './../projectPage/ProjectHeader.js'
import HeroImage from './../projectPage/HeroImage.js'
import SectionOne from './../projectPage/SectionOne.js'

const data = {
  'heroImage':require('./../../content/projects/bigData/hero-image.jpg'),
}

const a = {
  'title':'Explaining',
  'text':'We used linear regression to look for trends in the data. The R-squared value, tells us how correlated our variables are. The maximum R-squared value is 1 and the minimum is 0 and a value of greater than 0.64 is considered a strong correlation.',
  'image':'1.png'
}

function BigData(props) {
    return(
      <div>
        <ProjectHeader
         projectKey='bigData'
        />
        <HeroImage
         heroImage={data.heroImage}
        />
        <SectionOne
         title={a.title}
         text={a.text}
         image={a.image}
        />
      </div>
    )
}

export default BigData;
